import React from 'react';
import { List } from 'antd';

const FolloList= ({ header, data }) => {
  const style = useMemo(() => ({ marginBottom: '20px' } ), [])
  return (
    <List
      style={style}
      grid={{ gutter: 4, xs: 2, md: 3 }}
      size="samll"

      header={<div>{header}</div>}
    />
  );
};

export default FolloList;
